import React from 'react'
import { View, Text, StyleSheet } from 'react-native'

export default function ReadX(){
  return(
    <View style={styles.container}>
      <Text style={styles.titleText}>
        Read
      </Text>
    </View>
  )
}

const styles=StyleSheet.create({
  container:{
    flex:1,
    backgroundColor:'#fff',
    alignItems:'center',
  },
  titleText:{
    color:'#f20a4f',
    fontSize:25, 
    fontWeight:'bold',
    fontFamily:'calibri'
  }

})
